import React,{ Component } from 'react';
import Header from './Header';
import '../App.css';

class Register extends Component{
render(){
    return(
        <div className="container">
        <form style={{width:"30%", margin:"auto", marginTop:"15%", height:"90%"}} className="Shadow">
        <legend className="bg-success text-light text-center" style={{fontFamily:"Helvetica-Neue"}}>SIGN UP</legend><br />
        <div style={{width:"90%", margin:"auto"}}>
        <div className="form-group" id="mailg">
        <input type="text" name="mail" className="form-control" placeholder="E-Mail" id="mail" /><br />
        </div>
        <div className="form-group">
        <input type="password" name="pass" className="form-control"  placeholder="Password" />
        </div><br />
        <div className="form-group">
        <input type="submit" className="btn btn-success" name="submit" value="Sign Up" id="submit"/>
        </div>
        </div>
        </form>
        </div>

    );
}
}
class Order extends Component {
    render(){
        return(
            <div>
            <Header />
            <Register />
            </div>
        );
    }
}
export default Order;
